CREATE OR REPLACE TRIGGER "AGDOI"."AG_DLG_AG_COMP_TRG" AFTER INSERT OR DELETE OR UPDATE ON "AGDOI"."AG_AGENT_LICENSE_JURISTIC_T" REFERENCING OLD AS "OLD" NEW AS "NEW" FOR EACH ROW
DECLARE
      V_COMP_NAMET  AS_COMPANY_T.COMP_NAMET%TYPE;
      V_COMP_NAMEE                       AS_COMPANY_T.COMP_NAMEE%TYPE;
      V_COMP_TYPE_CODE                   AS_COMPANY_T.COMP_TYPE_CODE%TYPE;

      V_DATE_LICENSE_ACT                 AG_LICENSE_T.DATE_LICENSE_ACT%TYPE;
      V_REVOKE_LICENSE_DATE          AG_LICENSE_T.REVOKE_LICENSE_DATE%TYPE;
      V_EXPIRE_DATE           AG_LICENSE_T.EXPIRE_DATE%TYPE;

      V_INSURANCE_TYPE         AG_LICENSE_TYPE_R.INSURANCE_TYPE%TYPE;
      V_JURIS_PERSON_TYPE          AG_LICENSE_TYPE_R.JURIS_PERSON_TYPE%TYPE;
BEGIN
    IF INSERTING or UPDATING THEN
       BEGIN
     SELECT substr(COMP_NAMET,1,80)
  ,substr(COMP_NAMEE,1,80)
  ,COMP_TYPE_CODE
   INTO V_COMP_NAMET
    ,V_COMP_NAMEE
    ,V_COMP_TYPE_CODE
   FROM AS_COMPANY_T
   WHERE COMP_CODE = :NEW.COMPANY_CODE;
       EXCEPTION
     WHEN OTHERS THEN NULL;
       END;
       BEGIN
     SELECT DATE_LICENSE_ACT, REVOKE_LICENSE_DATE, EXPIRE_DATE
   INTO V_DATE_LICENSE_ACT, V_REVOKE_LICENSE_DATE, V_EXPIRE_DATE
   FROM AG_LICENSE_T
   WHERE LICENSE_NO = :NEW.LICENSE_NO ;
       EXCEPTION
     WHEN OTHERS THEN NULL;
       END;
       BEGIN
     SELECT INSURANCE_TYPE, JURIS_PERSON_TYPE
   INTO V_INSURANCE_TYPE, V_JURIS_PERSON_TYPE
   FROM AG_LICENSE_TYPE_R
   WHERE LICENSE_TYPE_CODE = :NEW.LICENSE_TYPE_CODE ;
       EXCEPTION
     WHEN OTHERS THEN NULL;
       END;
    END IF;
    IF INSERTING THEN
            BEGIN
     ,COMP_ID
     ,COMP_DATE
     ,COMP_CATE
     ,COMP_NAME
     ,COMP_NAME_E
     ,INSURE_CAT
     ,SERV_CAT
     ,COMP_CODE
     ,COMP_TYPE
     ,CANCEL_DATE
     ,APP_DATE
     ,EXP_DATE)
                          VALUES (:NEW.LICENSE_NO
     ,:NEW.REGISTER_COMP_NO
     ,V_DATE_LICENSE_ACT
     ,substr(:NEW.LICENSE_TYPE_CODE,-1)
     ,V_COMP_NAMET
     ,V_COMP_NAMEE
     ,V_INSURANCE_TYPE
     ,V_JURIS_PERSON_TYPE
     ,:NEW.COMPANY_CODE
     ,V_COMP_TYPE_CODE
     ,V_REVOKE_LICENSE_DATE
     ,V_DATE_LICENSE_ACT
     ,V_EXPIRE_DATE);
              EXCEPTION
                   WHEN DUP_VAL_ON_INDEX THEN
                    BEGIN
                      UPDATE  DLG_AG_COMP
                                           SET  AGENT_ID  = :NEW.LICENSE_NO
     ,COMP_ID     = :NEW.REGISTER_COMP_NO
     ,COMP_DATE   = V_DATE_LICENSE_ACT
     ,COMP_CATE   = :NEW.LICENSE_TYPE_CODE
     ,COMP_NAME   = V_COMP_NAMET
     ,COMP_NAME_E = V_COMP_NAMEE
     ,INSURE_CAT  = V_INSURANCE_TYPE
     ,SERV_CAT    = V_JURIS_PERSON_TYPE
     ,COMP_CODE   = :NEW.COMPANY_CODE
     ,COMP_TYPE   = V_COMP_TYPE_CODE
                  ,CANCEL_DATE   = V_REVOKE_LICENSE_DATE
               ,APP_DATE     = V_DATE_LICENSE_ACT
                  ,EXP_DATE = V_EXPIRE_DATE
                                         WHERE AGENT_ID      = :NEW.LICENSE_NO
                           AND COMP_CATE  = :NEW.LICENSE_TYPE_CODE;
                                  EXCEPTION
                                       WHEN OTHERS THEN NULL;
                               END;
WHEN OTHERS THEN NULL;
            END;
    ELSIF UPDATING  THEN
           BEGIN
             UPDATE  DLG_AG_COMP
                     SET AGENT_ID   = :NEW.LICENSE_NO
  ,COMP_ID     = :NEW.REGISTER_COMP_NO
  ,COMP_DATE   = V_DATE_LICENSE_ACT
  ,COMP_CATE   = :NEW.LICENSE_TYPE_CODE
  ,COMP_NAME   = V_COMP_NAMET
  ,COMP_NAME_E = V_COMP_NAMEE
  ,INSURE_CAT  = V_INSURANCE_TYPE
  ,SERV_CAT    = V_JURIS_PERSON_TYPE
  ,COMP_CODE   = :NEW.COMPANY_CODE
  ,COMP_TYPE   = V_COMP_TYPE_CODE
               ,CANCEL_DATE   = V_REVOKE_LICENSE_DATE
            ,APP_DATE     = V_DATE_LICENSE_ACT
               ,EXP_DATE = V_EXPIRE_DATE
              WHERE AGENT_ID      = :OLD.LICENSE_NO
           AND COMP_CATE  = :OLD.LICENSE_TYPE_CODE;
                EXCEPTION
                   WHEN OTHERS THEN NULL;
           END;
   ELSIF DELETING  THEN
           BEGIN
   DELETE DLG_AG_COMP
   WHERE AGENT_ID      = :OLD.LICENSE_NO
             AND COMP_CATE  = :OLD.LICENSE_TYPE_CODE;
              EXCEPTION
                   WHEN OTHERS THEN NULL;
           END;
   END IF;

END;
CREATE OR REPLACE TRIGGER "AGDOI"."AG_DLG_COMP_CODE_TRG" AFTER INSERT OR DELETE OR UPDATE ON "AGDOI"."AG_AGENT_LICENSE_JURISTIC_T" REFERENCING OLD AS "OLD" NEW AS "NEW" FOR EACH ROW
DECLARE
      V_COMP_NAMET		AS_COMPANY_T.COMP_NAMET%TYPE;
      V_COMP_NAMEE                      	AS_COMPANY_T.COMP_NAMEE%TYPE;
      V_COMP_ABBR_NAMET                 	AS_COMPANY_T.COMP_ABBR_NAMET%TYPE;
      V_COMP_ABBR_NAMEE                 	AS_COMPANY_T.COMP_ABBR_NAMEE%TYPE;
      V_PAY_LICENSE_DATE                	AS_COMPANY_T.PAY_LICENSE_DATE%TYPE;
      V_COMP_TYPE_CODE                  	AS_COMPANY_T.COMP_TYPE_CODE%TYPE;
      V_DATE_LICENSE_ACT                	AG_LICENSE_T.DATE_LICENSE_ACT%TYPE;
BEGIN
    IF INSERTING or UPDATING THEN
       BEGIN
    	SELECT substr(COMP_NAMET,1,80)
		,substr(COMP_NAMEE,1,80)
		,substr(COMP_ABBR_NAMET,1,40)
		,substr(COMP_ABBR_NAMEE,1,40)
		,PAY_LICENSE_DATE
		,COMP_TYPE_CODE
	  INTO V_COMP_NAMET
		  ,V_COMP_NAMEE
		  ,V_COMP_ABBR_NAMET
		  ,V_COMP_ABBR_NAMEE
		  ,V_PAY_LICENSE_DATE
		  ,V_COMP_TYPE_CODE
	  FROM AS_COMPANY_T
	  WHERE COMP_CODE = :NEW.COMPANY_CODE;
       EXCEPTION
    	WHEN OTHERS THEN NULL;
       END;
       BEGIN
    	SELECT DATE_LICENSE_ACT
	  INTO V_DATE_LICENSE_ACT
	  FROM AG_LICENSE_T
	  WHERE LICENSE_NO = :NEW.LICENSE_NO ;
       EXCEPTION
    	WHEN OTHERS THEN NULL;
       END;
    END IF;
    IF INSERTING THEN
            BEGIN
						,COMP_TNAME
						,COMP_ENAME
						,COMP_NAME
						,COMP_NAME_ENG
						,COMP_ID
						,COMP_ID_DATE
						,COMP_REG
						,LAST_PREMIUM_DATE
						--,INSURE_ALL_TYPE
						,COMP_TYPE)
             	            VALUES	(:NEW.COMPANY_CODE
					,V_COMP_NAMET
					,V_COMP_NAMEE
					,V_COMP_ABBR_NAMET
					,V_COMP_ABBR_NAMEE
					,:NEW.LICENSE_NO
					,V_DATE_LICENSE_ACT
					,:NEW.REGISTER_COMP_NO
					,V_PAY_LICENSE_DATE
					,V_COMP_TYPE_CODE);
             	EXCEPTION
                  	WHEN DUP_VAL_ON_INDEX THEN
                  		BEGIN
                  		 	UPDATE  DLG_COMP_CODE
                  		                       SET  COMP_CODE	 = :NEW.COMPANY_CODE
                  				,COMP_TNAME	 = V_COMP_NAMET
                  				,COMP_ENAME 	 = V_COMP_NAMEE
                             				,COMP_NAME  	 = V_COMP_ABBR_NAMET
	                  			,COMP_NAME_ENG = V_COMP_ABBR_NAMEE
	                  			,COMP_ID       	 = :NEW.LICENSE_NO
	                  			,COMP_ID_DATE  	 = V_DATE_LICENSE_ACT
	                  			,COMP_REG      	 = :NEW.REGISTER_COMP_NO
	                  			,LAST_PREMIUM_DATE	= V_PAY_LICENSE_DATE
	                  			,COMP_TYPE         		= V_COMP_TYPE_CODE
             	                    		     WHERE COMP_CODE  = :NEW.COMPANY_CODE ;
                               			EXCEPTION
                                  		  	WHEN OTHERS THEN NULL;
                            		 END;
                  	WHEN OTHERS THEN NULL;
            END;
    ELSIF UPDATING  THEN
           BEGIN
             UPDATE  DLG_COMP_CODE
                    SET  COMP_CODE	 = :NEW.COMPANY_CODE
		,COMP_TNAME	 = V_COMP_NAMET
		,COMP_ENAME 	 = V_COMP_NAMEE
		,COMP_NAME  	 = V_COMP_ABBR_NAMET
		,COMP_NAME_ENG = V_COMP_ABBR_NAMEE
		,COMP_ID       	 = :NEW.LICENSE_NO
		,COMP_ID_DATE  	 = V_DATE_LICENSE_ACT
		,COMP_REG      	 = :NEW.REGISTER_COMP_NO
		,LAST_PREMIUM_DATE	= V_PAY_LICENSE_DATE
		,COMP_TYPE         		= V_COMP_TYPE_CODE
             	   WHERE COMP_CODE  = :OLD.COMPANY_CODE ;
             	EXCEPTION
                  	WHEN OTHERS THEN NULL;
           END;
   ELSIF DELETING  THEN
           BEGIN
	  DELETE DLG_COMP_CODE
	  WHERE COMP_CODE 	= :OLD.COMPANY_CODE ;
             	EXCEPTION
                  	WHEN OTHERS THEN NULL;
           END;
   END IF;

END;
